        <div className="testingthespace">
          <div className="homePageBlueArea">
            <div className="title">
             
              <div style={{ opacity: 1 }}>
                <h1 style={{ color: isNight ? 'snowwhite' : 'black' }}>{Title}</h1>
              </div>
              <Card className="subtitle" style={{ margin: '10px' }}>
                <p style={{ opacity: 1 }}>{subTitle}</p>
              </Card>
              {/*      <AnimatePresence>
